import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AppDiscViewContainerComponent } from './catalog/view/app-disc-view.container';

@NgModule({
  declarations: [
    AppComponent,
    MaxDiscViewContainerComponent,
    DiscViewContainerComponent,
    AppDiscViewContainerComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
